import React from 'react';
import { Link, NavLink } from 'react-router-dom';

const About = () => {
  return (
    <>
      <h1>About</h1>
      <ul>
        <li>
          <Link className="contact1" to="/">
            Go to Home
          </Link>
        </li>
        <NavLink className="contact" to="/contact">
          Go to Contact
        </NavLink>
      </ul>
    </>
  );
};

export default About;
